iOS多线程/.body:
[TOC]
iOS多线程
主线程

耗时操作不能放在主线程中 

UI相关的操作必须在主线程中 

几乎所有方法都在主线程中 


判断是否是主线程

打印出来的 number == 1 就是主线程 

类方法 判断当前线程是否是主线程 

[NSThread isMainThread] 


对象方法 判断给定线程是否是主线程 

[childThread isMainThread]; 



多线程的实现

pThread C 由程序员管理 

NSThread OC 由程序员管理 

GCD C 自动管理 经常使用 

NSOperation OC 对于GCD的封装 经常使用 


线程的状态

启动 

- (void)start; 


睡眠/暂停 

+ (void)sleepForTimeInterval:;

+(void)sleepUntilDate:[NSDate ..];休眠一个NSDate对象 
3.结束 

+ (void)exit; 
多线程的安全隐患




多个线程访问同一块资源会发生数据安全问题 
解决方法 加互斥（同步）锁
@synchronized( 锁对象 ){ 

要加锁的代码段 

}


锁对象建议直接使用self 

锁对象是全局唯一变量 

加多把锁是无效的 

注意加锁的位置 

注意加锁的时期（资源抢夺的时候） 

加锁会影响性能消耗大量CPU资源 


线程同步|线程异步（进程并行）

多条线程按顺序执行有一个排队的过程 

多条线程并行执行 


nonatomic|atomic

atomic是线程安全的（不写默认就是atomic） 

内部会对setter方法加锁 

会消耗CPU的资源 

不一定是完全安全的 

不能保证数据的可靠性 仅仅实在读和写加上了同步锁，但是如果a写入之后b再写入，a再读取数据---得到的数据是被b修改过的数据不可靠 




nonatomic是线程不安全的 

由于性能好多半使用nonatomic 

尽量避免多线程抢夺资源 




