单例模式
创建出来的对象一直是同一个，尝试重写alloc方法，保证永远只有一个对象控件 

static NSObject* instance; 

+(instancetype)allocWithZone:(struct NSZone*)zone{ 

@synchronized(self){ 

if(_instance == nil) 

{ 

_instance = [super allocWithZone]; 

} 

}//保证线程安全 

return _instance; 

}

此方法是alloc实际会调用的分配空间的方法 

static dispatch_once_t onceToken; 

dispatch_once(&onceToken,^{ 

_instance = [super allocWithZone]; 

});

更简单，instance只会执行一次

iOS多线程/NSThread.html.body:
NSThread
[TOC]
创建

NSThread* thread = [[NSThread alloc]initWithTarget:self selector:@selector(run) object:nil ]; 

[thread start];需要通过start启动，但是可以获取线程对象 


[NSThread detachNewThreadSelector:@selector(run) toTarget:self withObject:nil]; 

分离出一条子线程 创建并自动启动 


[self performSelectorInBackground:@selector(run) withObject:nil]; 
开启后台线程 使用NSObject方法创建并自动启动 
不是很安全 



设置属性

设置名称 

thread.name = @"线程01"; 
[thread setName:@"线程02"]; 


设置线程优先级 threadPriority 0.0~1.0 

优先级越高被调用次数越高 



进程之间通信
// 给主线程传值 

[self performSelectorOnMainThread:(nonnull SEL) 
 withObject:(nullable id) waitUntilDone:(BOOL)]; 

// 不推荐使用
[self performSelector:(nonnull SEL) onThread:(nonnull NSThread *)
 withObject:(nullable id) waitUntilDone:(BOOL)];

//  简单方法 就是直接用属性自带的setter方法 
[self.webImage performSelector:@selector(setImage:) 
 onThread:[NSThread mainThread] withObject:image waitUntilDone:YES];

1. SEL 方法选择器 

2. 调用函数要传递的参数 

3. 是否等待该方法执行完在才继续往下只想 YES等待

线程的生命周期

当线程内部的任务执行完毕线程自动释放

